import React from "react";
import "../CSS/Patterns.css";
import ascendingScallop from "../PICTURES/ascendingScallop.png";
function Patterns() {
    const images = [ascendingScallop];
    return (
        <div className="PatternsPage">
            {images.map((item) => {
                return (
                    <img
                        height="100%"
                        width="100%"
                        src={ascendingScallop}
                    ></img>
                );
            })}
        </div>
    );
}

export default Patterns;
